// FoodCard component to render individual food item
const FoodCard = ({ food }) => (
  <div className="food-card" key={food.id}>
    <img src={food.image_url} alt={food.name} className="food-image" />
    <h2 className="food-name">{food.name}</h2>
    <p className="food-description">{food.description}</p>
    <p className="food-price">${food.price.toFixed(2)}</p>
  </div>
);

// FoodList component to render a list of FoodCard components
const FoodList = () => {
  return (
    <div className="food-list">
      {foodData.foods.map(food => (
        <FoodCard key={food.id} food={food} />
      ))}
    </div>
  );
};

export default FoodList;
